fields.channel_description:
Суспільне Культура – канал Суспільного Мовлення України. Тут ви знайдете:
- влоги COOL`ТУРИМО про актуальні попкультурні події, гострі теми та критичне мислення;
- проєкт Artилерія, що знайомить із новими чи маловідомими артистами, які мають всі шанси отримати увагу широкої публіки;
- огляди на фільми, що вийшли в український прокат;
- інтерв’ю з дієвцями культури в проєкті «Культурний інстинкт»;
- подкаст «Книгосховище», що розповідає про книги, на які варто звернути увагу;
- інформаційно-аналітичний проєкт «Культура на часі» 
- актуальні документальні фільми та серіали власного виробництва та на замовлення Суспільного.

Суспільне Мовлення — найбільше незалежне медіа в Україні, до якого входять загальнонаціональні телеканали Перший та Суспільне Культура й радіостанції Українське Радіо, Радіо Промінь, Радіо Культура, а також 24 місцеві телерадіокомпанії та супутниковий телеканал Суспільне Новини. Новини про Україну читайте на сайті suspilne.media та діджитал-платформах.
